scanner :: String -> Either String [Token]
scanner str = runAlex str $ do
  let loop toks = do tok <- alexMonadScan
                     case tok of
                          [EndMarker] -> return $ (reverse (EndMarker:toks))
                          _ -> let foo = loop (tok ++ toks) in foo
  loop []

